INSERT INTO public.edition (id, isbn, binding, pages, price, description, release_date, book_id, pub_id) VALUES (1, '0307291812', 'hardcover', 815, 2700, 'Seconds before the Earth is demolished for a galactic freeway, Arthur Dent is saved by Ford Prefect, a researcher for the revised Guide. Together they stick out their thumbs to the stars and begin a wild journey through time and space.', '2010-01-01', 3, 1);
INSERT INTO public.edition (id, isbn, binding, pages, price, description, release_date, book_id, pub_id) VALUES (2, '9780134685991', 'твердый', 464, 22000, 'Третье издание охватывает особенности языка программирования и библиотек, появившихся в Java 7, 8 и 9, в том числе конструкции функционального программирования, добавленные к своим объектно-ориентированным корням. В книгу включены также многие новые советы, а также глава, посвященная лямбда-выражениям и потокам.', '2018-01-03', 4, 2);
INSERT INTO public.edition (id, isbn, binding, pages, price, description, release_date, book_id, pub_id) VALUES (3, '9785389141681', 'твердый', 384, 3550, 'В своей новой, резко провокационной и одновременно предельно прагматичной книге неподражаемый Николас Нассим Талеб рассказывает, как важно идентифицировать и фильтровать чушь, отличать теорию от практики, поверхностную компетентность от настоящей.', '2017-12-28', 5, 3);
INSERT INTO public.edition (id, isbn, binding, pages, price, description, release_date, book_id, pub_id) VALUES (5, '9785699948239', 'Твердый', 208, 3500, 'Новые исследования позволяют предположить, что растения способны на большее, чем мы себе представляем.
Они чувствуют, коммуницируют, спят, едят, думают...
Стефано Манкузо, проведя многочисленные исследования, пришел к ошеломительным выводам о том, что растения — это сложные живые существа, способные к социальной жизни.', '2018-01-18', 12, 10);
INSERT INTO public.edition (id, isbn, binding, pages, price, description, release_date, book_id, pub_id) VALUES (4, '9780393316049', 'hardcover', 352, 1500, 'A New York Times bestseller―the outrageous exploits of one of this century''s greatest scientific minds and a legendary American original.', '1997-04-17', 6, 4);
INSERT INTO public.edition (id, isbn, binding, pages, price, description, release_date, book_id, pub_id) VALUES (7, '9785845919847', 'Hardcover', 672, 24000, 'The bible of all fundamental algorithms and the work that taught many of today''s software developers most of what they know about computer programming.', '1997-04-08', 14, 12);
INSERT INTO public.edition (id, isbn, binding, pages, price, description, release_date, book_id, pub_id) VALUES (6, '9780132350884', 'Hardcover', 464, 10850, 'Noted software expert Robert C. Martin, presents a revolutionary paradigm with Clean Code: A Handbook of Agile Software Craftsmanship. Martin, who has helped bring agile principles from a practitioner’s point of view to tens of thousands of programmers, has teamed up with his colleagues from Object Mentor to distill their best agile practice of cleaning code “on the fly” into a book that will instill within you the values of software craftsman, and make you a better programmer―but only if you work at it.', '2008-08-01', 13, 11);
INSERT INTO public.edition (id, isbn, binding, pages, price, description, release_date, book_id, pub_id) VALUES (8, '9785041009212', 'Твердый', 896, 2950, '"Братья Карамазовы" — итоговый роман Ф.М. Достоевского, в нем сконцентрировались вся художественная мощь писателя и глубина прозрений религиозного мыслителя. "Братья Карамазовы" — это итоговое произведение, в котором испепеляющая страсть, борьба за наследство, богоискательство выводят на глобальные вопросы о самой сущности человека, о его природе. Каждый характер, как бы сложен он ни был, у Достоевского предстает некой частью одной, почти безграничной картины — это картина многогранной человеческой души, и в этой душе, и за эту душу идет нескончаемая битва добра и зла.', '2019-02-09', 16, 13);
INSERT INTO public.edition (id, isbn, binding, pages, price, description, release_date, book_id, pub_id) VALUES (9, '0143127748', 'Hardcover', 464, 5010, 'Trauma is a fact of life. Veterans and their families deal with the painful aftermath of combat; one in five Americans has been molested; one in four grew up with alcoholics; one in three couples have engaged in physical violence. Dr. Bessel van der Kolk, one of the world’s foremost experts on trauma, has spent over three decades working with survivors.', '2015-09-08', 17, 14);


